import React from 'react';

const ImageList = (props) => {

    const images = props.images.map( ({ description, id, urls }) => {
        return <img src={image.urls.regular} key={image.id} alt={image.description}/>
    })

    return (
        <div>{ images }</div>
    )
}

export default ImageList;
